def directory_file(file_name):
    list=os.listdir()
    return file_name in list 


def open_file(x,file_name,sheet_name)->Workbook:
    if  directory_file(file_name)==False:
        wb=Workbook()
        print('done')
        ws=wb.active
        ws.title=sheet_name
        wb.save(file_name)
        print(x)
        if(wb is not None):
            update_file(wb,x,sheet_name)
        return wb
    wb=load_workbook(file_name)
    print(x is not None)
    if(x is not None):
            update_file(wb,x,sheet_name,file_name)
    return wb

def update_file(wb:Workbook,x :list,sheet_name,file_name):
    try:
        ws=wb[sheet_name]
    except:
        ws=wb.create_sheet(sheet_name)
    for i in x:
        ws.append([i.strip() for i in i])
    wb.save(file_name)


def distinct_governorate(wb):
    ws=wb['table_locations']
    return list(set([i.value for i in ws['a']]))
def distinct_city(wb):
    ws=wb['table_locations']
    l1=[]
    l2=[]
    for i in range(1,ws.max_row):
        if ws['a'+str(i)].value in l1 and ws['b'+str(i)].value  in l2:
            continue
        l1.append(ws['a'+str(i)].value)
        l2.append(ws['b'+str(i)].value)
    return l1,l2


def distinct_village(wb):
    ws=wb['table_locations']
    l1=[]
    l2=[]
    for i in range(1,ws.max_row):
        if ws['b'+str(i)].value in l1 and ws['c'+str(i)].value  in l2:
            continue
        l1.append(ws['b'+str(i)].value)
        l2.append(ws['c'+str(i)].value)
    return l1,l2
